import React, { useState } from "react";
import axios from "axios";
import "../styles/SignUp.css";

function SignUp() {
  const [user_firstname, setUserfirstname] = useState("");
  const [user_lastname, setUserlastname] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  async function save(event) {
    event.preventDefault();
    try {
      await axios.post("http://localhost:8090/api/v1/employee/save", {
        firstname: user_firstname,
        lastname: user_lastname,
        email: email,
        password: password,
      });
      alert("User Registered Successfully");
    } catch (err) {
      alert(err);
    }
  }

  return (
    <div className="container mt-4">
      <div className="card registration-card">
        <h1>User Registration</h1>

        <form>
          <div className="form-group">
            <label>User First name</label>
            <input
              type="text"
              className="form-control"
              placeholder="Enter First Name"
              value={user_firstname}
              onChange={(event) => {
                setUserfirstname(event.target.value);
              }}
            />
          </div>

          <div className="form-group">
            <label>User Last name</label>
            <input
              type="text"
              className="form-control"
              placeholder="Enter Last Name"
              value={user_lastname}
              onChange={(event) => {
                setUserlastname(event.target.value);
              }}
            />
          </div>

          <div className="form-group">
            <label>Email</label>
            <input
              type="email"
              className="form-control"
              placeholder="Enter Email"
              value={email}
              onChange={(event) => {
                setEmail(event.target.value);
              }}
            />
          </div>

          <div className="form-group">
            <label>Password</label>
            <input
              type="password"
              className="form-control"
              placeholder="Enter password"
              value={password}
              onChange={(event) => {
                setPassword(event.target.value);
              }}
            />
          </div>

          <button type="submit" className="btn btn-primary mt-4" onClick={save}>
            Save
          </button>
        </form>
      </div>
    </div>
  );
}

export default Register;
